import "./TripInfo.css";  

function TripInfo() { 
  return (
    <React.Fragment>
      <box>
        <p>Details of your trip</p>
        <p>Day 1:</p>
        <p>Vina Robles winery</p>
        <p>Day 2:</p>
        <p>Sensorio Field of Lights</p>
        <p>Day 3:</p>
        <p>Check out of your accomodation and head back to Los Angeles</p>
      </box>
    </React.Fragment>
  )
}

export default TripInfo;
